import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import Axios from 'axios';
import { Link } from 'react-router-dom';

const EditWorkout = () => {
  const [exercise, setExercise] = useState("");
  const [sets, setSets] = useState(0);
  const [reps, setReps] = useState("");
  const [weight, setWeight] = useState("");
  const { tableName } = useParams();
  const [tableData, setTableData] = useState([]);

  useEffect(() => {
    Axios.get(`http://localhost:3001/tables/${tableName}`)
      .then((response) => {
        setTableData(response.data.map(exercise => ({ ...exercise, ticked: false })));
      })
      .catch((error) => {
        console.error('Error fetching data:', error);
      });
  }, [tableData, tableName]);

  const deleteExercise = (id) => {
    Axios.delete(`http://localhost:3001/tables/${tableName}/delete/${id}`)
      .then(() => {
        setTableData(tableData.filter(exercise => exercise.id !== id));
      })
      .catch(error => console.error('Error deleting exercise:', error));
  };

  const addFullExercise = () => {
    Axios.post(`http://localhost:3001/create/${tableName}`, {
      exercise: exercise,
      sets: sets,
      reps: reps,
      weight: weight
    }).then(() => {
      setTableData([...tableData, {
        exercise: exercise,
        sets: sets,
        reps: reps,
        weight: weight
      }]);
      setExercise("");
      setSets(0);
      setReps("");
      setWeight("");
    }).catch(error => {
      console.error('Error adding exercise:', error);
    });
  };

  return (
    <div className="bg-black py-8">
      <div className="container mx-auto px-4">
        <h2 className="text-white mb-4">{tableName}</h2>
        <div className="overflow-x-auto sm:overflow-x-visible">
          <div className="flex flex-col">
            <div className="flex bg-Green text-darkGray-bold py-2 px-4">
              <div className="w-1/4 sm:w-1/6">Name</div>
              <div className="w-1/4 sm:w-1/6">Sets</div>
              <div className="w-1/4 sm:w-1/6">Reps</div>
              <div className="w-1/4 sm:w-1/6">Weight</div>
              <div className="w-1/4 sm:w-1/6">Action</div>
            </div>
            {tableData.map((exercise) => (
              <div key={exercise.id} className="flex bg-darkGray text-white py-2 px-4">
                <div className="w-1/4 sm:w-1/6">{exercise.Exercise}</div>
                <div className="w-1/4 sm:w-1/6">{exercise.Sets}</div>
                <div className="w-1/4 sm:w-1/6">{exercise.Reps}</div>
                <div className="w-1/4 sm:w-1/6">{exercise.Weight}</div>
                <div className="w-1/4 sm:w-1/6 flex justify-center">
                  <button className="bg-red-500 text-white px-2 py-1 rounded-md" onClick={() => deleteExercise(exercise.id)}>
                    Delete
                  </button>
                </div>
              </div>
            ))}
            <div className="flex bg-darkGray text-white py-2 px-4">
              <input type="text" value={exercise} onChange={(event) => setExercise(event.target.value)} className="w-1/4 sm:w-1/6 px-2 py-1 rounded-md" />
              <input type="number" value={sets} onChange={(event) => setSets(event.target.value)} className="w-1/4 sm:w-1/6 px-2 py-1 rounded-md" />
              <input type="text" value={reps} onChange={(event) => setReps(event.target.value)} className="w-1/4 sm:w-1/6 px-2 py-1 rounded-md" />
              <input type="text" value={weight} onChange={(event) => setWeight(event.target.value)} className="w-1/4 sm:w-1/6 px-2 py-1 rounded-md" />
              <div className="w-1/4 sm:w-1/6 flex justify-center">
                <button onClick={addFullExercise} className="bg-green-500 text-white px-2 py-1 rounded-md">Add Exercise</button>
              </div>
            </div>
          </div>
        </div>
      </div>
      <Link to="/" className="block text-center text-white mt-4">Finish</Link>
    </div>
  );
};

export default EditWorkout;
